import React from 'react';
import styled from 'styled-components';
import EnrollListItem from './EnrollListItem';

const EnrollArea = styled.div`
    background-color: #fff;
    width: 1200px;   
    height: 800px;
    border-radius: 2px;
    box-shadow: 0px 5px 10px 1px #0004;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 30px;
`;

const EnrollUl = styled.ul`
    width: 100%;
`;

const EnrollHead = styled.li`
    background-color: #aaf;
    & ul {
        display: flex;
    }
`

const EnrollLi = styled.li`

`;

const EnrollNumber = styled.li`
    width: 70px;
`


const EnrollList = () => {
    return (
        <EnrollArea>
            <EnrollUl>
                <EnrollHead>
                    <ul>
                        <EnrollNumber>#</EnrollNumber>
                        <li>제목</li>
                        <li>개설자</li>
                        <li>개설일</li>
                        <li>마감일</li>
                        <li>상태</li>
                        <li>조회</li>
                    </ul>
                </EnrollHead>
            </EnrollUl>
        </EnrollArea>
    );
};

export default EnrollList;
